from timeit import default_timer as timer
import sys

sys.setrecursionlimit(30002)


# part one
def factorialI(n):
    result = 1

    for num in range(1, n + 1):
        result *= num

    return result


# client for part one  -------------------------------
print('Testing iterative factorial calculator:')
print('4!:', factorialI(4))
print('7!:', factorialI(7))


""" -------------- SAMPLE RUN PART ONE ---------------

Testing iterative factorial calculator:
4!: 24
7!: 5040

---------------------- END SAMPLE RUN ---------------- """


# part two
def factorialR(n):
    """ with printing intermediate steps """
    print('factorial has been called with n = ' + str(n))
    if n == 1:
        return 1

    result = n * factorialR(n - 1)

    print('intermediate result for ', n, '* factorial(', n-1, '): ', result)
    return result


# client #1 for part two -----------------------------
print('\n\nTesting recursive factorial calculator '
      'WITH printing intermediate steps:')
print('4!:', factorialR(4))
print()
print('7!:', factorialR(7))


def factorialR(n):
    """ without printing intermediate steps """
    if n == 1:
        return 1

    result = n * factorialR(n - 1)

    return result


# client #2 for part two -----------------------------
print('\n\nTesting recursive factorial calculator '
      'WITHOUT printing intermediate steps:')
print('30000!:', factorialR(30000))


