# part three
def factorialI(n):
    result = 1
    for num in range(1, n + 1):
        result *= num
    return result


def func_to_measure():
    result = factorialI(20)
    return result


# client #1 for part three ---------------------------
print('\n\n1000000 runs of 20! using iterative factorial method:')
print('starting timer')
start = timer()
for i in range(1000000):
    func_to_measure()
end = timer()

elapsed = end - start
print("elapsed time:", elapsed, "secs")


def factorialR(n):
    # print('factorial has been called with n = ' + str(n))
    if n == 1:
        return 1

    result = n * factorialR(n - 1)

    # print('intermediate result for ', n, '* factorial(', n-1, '): ', result)
    return result


def func_to_measure():
    result = factorialR(20)
    return result


# client #2 for part three ---------------------------
print('\n\n1000000 runs of 20! using recursive factorial method:')
print('starting timer')
start = timer()
for i in range(1000000):
    func_to_measure()
end = timer()

elapsed = end - start
print("elapsed time:", elapsed, "secs")


